import React from 'react';
import { useLogged } from '../App';


export function Home(props) {

    var { data } = useLogged()

    return (
        <div>
            {
                data?.logged === true &&
                <div>
                    <p> user: {props.user}</p>
                    <p> password: {props.password}</p>
                </div>
            }
        </div>
    )
}
